pub macro helped { // () => { helper!() } // This might lead to an error due to 'helper' not being in scope. () => { $crate::helper!() }
} pub macro helper { () => { () }
} //// Usage in another crate.
// Note that `helper_macro::helper` is not imported!
use helper_macro::helped; fn unit() { helped!();
} Note that, because $crate refers to the current crate, it must be used with a fully qualified module path when referring to non-macro items: pub mod inner { pub macro call_foo { () => { $crate::inner::foo() }; } pub fn foo() {}
} Additionally, even though $crate allows a macro to refer to items within its own crate when expanding, its use has no effect on visibility. An item or macro referred to must still be visible from the invocation site. In the following example, any attempt to invoke call_foo!() from outside its crate will fail because foo() is not public. pub macro call_foo { () => { $crate::foo() };
